        "body" : "PREFIX pollinator: <https://www.lancaster.ac.uk/pg/nundloll/SolarPark/PollinatorData#>\nPREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>\nPREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>\n\nPREFIX soil: <https://www.lancaster.ac.uk/pg/nundloll/SolarPark/SoilData#>\nselect DISTINCT * where {\n    \n{\nselect ?sitevalue ?date ?obsValue ?polarity ?subjectivity ?honeyhives ?sheep where { \n\t?site rdf:type soil:Site.\n    ?site pollinator:hasValue ?sitevalue.\n    ?site pollinator:hasObservationDate ?date.\n    \n    ?site pollinator:has ?obs.\n    ?obs rdfs:member pollinator:SiteObservation.\n    \n    ?obs pollinator:hasObservation ?obsValue.\n    ?obs pollinator:hasPolarity ?polarity.\n    ?obs pollinator:hasSubjectivity ?subjectivity.\n    \n    ?obs pollinator:hasHoneyHives ?honeyhives.\n    ?obs pollinator:hasSheep ?sheep.\n    \n    FILTER(REGEX(?sitevalue, \"SiteA\"))\n    \n} limit 100 \n        \n}\nUNION\n{\n select ?sitevalue ?authorname ?company ?county ?location ?postcode where  { \n\t?s rdfs:member soil:Site.\n    ?s soil:collectedBy soil:Author.\n    soil:Author soil:hasValue ?authorname.\n    ?s soil:hasValue ?sitevalue.\n    ?s soil:hasSiteDesc ?sitedesc1, ?sitedesc2, ?sitedesc3, ?sitedesc4, ?sitedesc5, ?sitedesc6,     ?sitedesc7.\n            \n    ?sitedesc1 rdfs:member soil:Company.\n    ?sitedesc1 soil:hasValue ?company.\n\n    ?sitedesc2 rdfs:member soil:County.\n    ?sitedesc2 soil:hasValue ?county.\n    \n    ?sitedesc3 rdfs:member soil:Location.\n    ?sitedesc3 soil:hasValue ?location.\n    \n    ?sitedesc4 rdfs:member soil:Post_Code.\n    ?sitedesc4 soil:hasValue ?postcode.\n    \n    FILTER(REGEX(?sitevalue, \"SiteA\"))\n            \n} limit 100 \n\n}\n   \n}\n",
        "shared" : true
